import React, { Fragment } from "react";
import styled from "styled-components";

const Container = styled.div`
  height: 30%;
  padding: 0 2rem;
  width: 100%;
  box-shadow: #e9e9e9 0px 1px 4px;
  margin: 30px 0;
`;

const SearchFormFields = [
  {
    type: "text",
    name: "min",
    placeholder: "Min",
    label: "Amount",
  },
  {
    type: "text",
    name: "max",
    placeholder: "Max",
    label: "",
  },
  {
    type: "text",
    name: "binNumber",
    placeholder: "Bin Num",
    label: "BIN Number",
  },
  {
    type: "email",
    name: "email",
    placeholder: "Email",
    label: "Email",
  },
];

export const FormGroup = styled.div``;
export const FormDesc = styled.h3`
  color: #888;
`;

export const Input = styled.input`
  padding: 0.4rem 3rem 0.4rem 0.8rem;
  font-size: 1rem;
  font-weight: 300;
  border: 1px solid #ccc;
  border-radius: 25px;
  width: 100px;
`;

const SecondSearchRow = styled.form`
  display: flex;
`;

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  margin: 0 1rem;
`;

const Search = () => {
  return (
    <Container>
      <SecondSearchRow>
        <Wrapper>
          <FormDesc>Decision</FormDesc>
          <select>
            <option value="0">first</option>
            <option value="1">second</option>
            <option value="2">third</option>
          </select>
        </Wrapper>
        <Wrapper>
          <FormDesc>Payment</FormDesc>
          <select>
            <option value="0">first</option>
            <option value="1">second</option>
            <option value="2">third</option>
          </select>
        </Wrapper>

        {SearchFormFields.map((formField, index) => {
          const { type, name, placeholder, label } = formField;
          return (
            <Wrapper key={index}>
              <FormDesc>{label}</FormDesc>
                <Input
                  type={type}
                  name={name}
                  //   onChange={(e) => onChange(e)}
                  placeholder={placeholder}
                  //   value={formData[name]}
                />
            </Wrapper>
          );
        })}
        {/* <Button onClick={(e) => onSubmit(e)}>
          Submit
        </Button> */}
      </SecondSearchRow>
    </Container>
  );
};

export default Search;
